import React from "react";
import { IonPage, IonHeader, IonToolbar, IonTitle } from "@ionic/react";

interface registoAvaliacao {
    data: Date,
    peso: number
}

class Evolucao extends React.Component {

    state: {
        values: Array<registoAvaliacao>
    }

    constructor(props: any) {

        super(props);        

        this.state = ({
            values: new Array<registoAvaliacao>()
        });
    }

    componentDidMount() {

        this.state.values.push({data: new Date(2020, 0, 2), peso: 98});
        this.state.values.push({data: new Date(2020, 3, 25), peso: 98});
        this.state.values.push({data: new Date(2020, 6, 11), peso: 98});
        this.state.values.push({data: new Date(2020, 9, 9), peso: 98});
        this.state.values.push({data: new Date(2020, 12, 23), peso: 98});
    }

    render() {

        return(

            <IonPage>

                <IonHeader>
                    <IonToolbar color="primary">
                        <IonTitle id="page-title">Evolução</IonTitle>
                    </IonToolbar>
                </IonHeader>



            </IonPage>

        );
    }

}

export default Evolucao;
